import axios from "axios"

export const handleFilters = ({ minScore, level }) => {
    return {
        type: 'handleFilters',
        payload: {
            minScore,
            level
        }
    }
}

export const handleArrange = (arrange) => {
    return {
        type: 'handleArrange',
        payload: arrange
    }
}

export const updatePrice = (price) => {
    return {
        type: 'updatePrice',
        payload: price,
    }
}
